int runQueryConn(MYSQL* conn,  String *query ) {
    if(conn == (MYSQL*) NULL) return 1;
    int status =0; 
    if (error_log)
      sql_print_information("Http Monitor *runQueryConn*: %s",query->c_ptr() );
    status = mysql_real_query(conn,query->ptr(),query->length());
    return status;  
}

String getStatusHistoryPosition(MYSQL* conn) {
    MYSQL_ROW row;
    MYSQL_RES *result=NULL;
    String query=0;
 
    query.append((char*) "SELECT COALESCE((CAST(SUBSTRING_INDEX(max(CONCAT( COLUMN_GET(status, 'date' as char ), '_' ,LPAD(id,5,'0'))),'_', -1) as unsigned ) +1) MOD ");
    query.append_ulonglong(http_monitor::history_length);
    query.append( (char*) ",1) AS pos FROM monitor_schema.http_status_history;");
    String pos;
    pos.append("1");
    if(!runQueryConn(conn,&query))
    {
       
    result = mysql_store_result(conn);
    if (result ) {
    
    if((row = mysql_fetch_row(result))){
         ulong *lengths = mysql_fetch_lengths(result);
        
         pos.free();
         pos.append(row[0],lengths[0]);
       
        if (error_log)
         sql_print_information ("Http monitor *getStatusHistoryPosition* : processing queue position %s", pos.c_ptr());
     
    }
    mysql_free_result(result); 
    }
    }   
  
    return  pos;
}


String getExplain(MYSQL* conn, Server* url,I_List<http_query>* http_queries) {
    MYSQL_ROW row;
    MYSQL_RES *result=NULL;
    
    String Server; 
    std::string stdServer;
    stdServer.append(url->getPath().str);
    Server.append(remove_letter(stdServer,'/').c_str() );
    
    http_query *aRow; 
   
    aRow = new http_query;
    aRow->query.append((char *) "CREATE TEMPORARY TABLE IF NOT EXISTS monitor_schema.tmp_explain ("
        "`ID` smallint(6) , "
        "`SELECT_TYPE`  varchar(64),"
        "`TABLE` BIGINT UNSIGNED NOT NULL DEFAULT 0,"
        "`TYPE` varchar(1024),"
        "`POSSIBLE_KEYS` varchar(1024) ,"
        "`KEY` varchar(1024) ,"
        "`KEY_LEN` smallint(6) ,"
        "`REF` varchar(1024) ,"
        "`ROWS` INT UNSIGNED ,"
        "`EXTRA` varchar(1024) "
        ") ENGINE=MEMORY ");
    http_queries->push_back(aRow);
   
    String saltQuery=0;
    saltQuery.append((char *) "SET @salt_key='");
    saltQuery.append(salt_key);
    saltQuery.append((char *) "'");
    runQueryConn(conn,&saltQuery);
     
    String query =0 ;
    query.append((char*) "SELECT CURRENT_SCHEMA ,SQL_TEXT, DIGEST FROM  monitor_schema.http_queries_sample WHERE SERVER_NAME=CONV(LEFT(MD5(CONCAT(@salt_key,'");
    query.append(Server) ;
    query.append( (char*) "',@salt_key) ), 16), 16, 10) AND EVENT_NAME like '%select'");
   
    if(!runQueryConn(conn,&query))
    {
       
    result = mysql_store_result(conn);
    if (result ) {
    
    while ((row = mysql_fetch_row(result))){
         ulong *lengths = mysql_fetch_lengths(result);
        
        aRow = new http_query;
         aRow->query.append((char *) "SELECT spider_direct_sql('EXPLAIN ");
         aRow->query.append(row[1],lengths[1]);
         aRow->query.append((char *) "','monitor_schema.tmp_explain','host \"");
         aRow->query.append(url->getHost().str);
         aRow->query.append((char *) "\" ,user \"");
         aRow->query.append(http_monitor::conn_user);
         aRow->query.append((char *) "\" ,password  \"");
         aRow->query.append(http_monitor::conn_password);
         aRow->query.append((char *) "\" ,port  \"");
         aRow->query.append(url->getPort().str);
         aRow->query.append((char *)"\" ,database \"");
         aRow->query.append(row[0],lengths[0]);
         aRow->query.append((char *) "\" ')");
         http_queries->push_back(aRow);
         sql_print_information ("adding explain query: %s",  aRow->query.c_ptr());
       
         aRow = new http_query;
         aRow->query.append((char *) "REPLACE INTO monitor_schema.http_explain  SELECT ID,TABLE, SELECT_TYPE,CONV(LEFT(MD5(CONCAT(@salt_key, `TABLE` ,@salt_key) ), 16), 16, 10) , `TYPE`,`POSSIBLE_KEYS`,`KEY`, `KEY_LEN`,`REF`,`ROWS`, "); 
         aRow->query.append(row[2],lengths[2]);
         aRow->query.append((char *)  ",CONV(LEFT(MD5(CONCAT(@salt_key,'");
         
         aRow->query.append(Server);
         aRow->query.append("',@salt_key) ), 16), 16, 10) FROM monitor_schema.tmp_explain");
         http_queries->push_back(aRow); 
       
         
         aRow = new http_query;
         aRow->query.append((char *) "TRUNCATE monitor_schema.tmp_explain ");
         http_queries->push_back(aRow); 
       
    }
  
    mysql_free_result(result); 
    }
    }   
  
     
    return  0;
}



String getSpiderMasterStatus(MYSQL* conn, Server* url,I_List<http_query>* http_queries) {
    MYSQL_ROW row;
    MYSQL_RES *result=NULL;
    
    String Server; 
    std::string stdServer;
    stdServer.append(url->getPath().str);
    Server.append(remove_letter(stdServer,'/').c_str() );
    
    http_query *aRow; 
   
    aRow = new http_query;
    aRow->query.append((char *) "CREATE TEMPORARY TABLE IF NOT EXISTS monitor_schema.tmp_master_status ("
       "`FILE` varchar(1024) CHARACTER SET utf8 DEFAULT NULL,"
       "`POSITION` BIGINT UNSIGNED NOT NULL DEFAULT 0,"
       "`BINLOG_DO_DB` varchar(4096) CHARACTER SET utf8 DEFAULT NULL,"
       "`BINLOG_IGNORE_DB` varchar(4096) CHARACTER SET utf8 DEFAULT NULL"
       ") ENGINE=MEMORY ");
    http_queries->push_back(aRow);
   
    
    aRow = new http_query;
    aRow->query.append((char *) "SELECT spider_direct_sql('SHOW MASTER STATUS ");
        
    aRow->query.append((char *) "','monitor_schema.tmp_master_status','host \"");
    aRow->query.append(url->getHost().str);
    aRow->query.append((char *) "\" ,user \"");
    aRow->query.append(http_monitor::conn_user);
    aRow->query.append((char *) "\" ,password  \"");
    aRow->query.append(http_monitor::conn_password);
    aRow->query.append((char *) "\" ,port  \"");
    aRow->query.append(url->getPort().str);
    aRow->query.append((char *)"\" ,database \"");
    aRow->query.append((char *)"mysql");
    aRow->query.append((char *) "\" ')");
    http_queries->push_back(aRow);
    sql_print_information ("adding master status query %s :",  aRow->query.c_ptr());
       
    aRow = new http_query;
    aRow->query.append((char *) "REPLACE INTO monitor_schema.http_master_status SELECT *,  "); 
    aRow->query.append((char *)  "CONV(LEFT(MD5(CONCAT(@salt_key,'");

    aRow->query.append(Server);
    aRow->query.append("',@salt_key) ), 16), 16, 10) FROM monitor_schema.tmp_master_status ");
    http_queries->push_back(aRow); 


    aRow = new http_query;
    aRow->query.append((char *) "TRUNCATE monitor_schema.tmp_master_status ");
    http_queries->push_back(aRow); 
     
    return  0;
}



std::string remove_letter( std::string str, char c )
{
   str.erase( std::remove( str.begin(), str.end(), c ), str.end() ) ;
    return str ;
 
}


bool createServer(MYSQL* conn,Server* url) {
    MYSQL_ROW row;
    MYSQL_RES *result=NULL;
    String query=0;
    
    std::string ServerName;
    ServerName.append(url->getPath().str);
    query.append((char*) "SELECT count(*) from mysql.servers WHERE Server_name like 'http_%_");
    query.append(remove_letter(ServerName,'/').c_str() ); 
    query.append((char*) "'");
    String pos;
    if(!runQueryConn(conn,&query))
    {
       
    result = mysql_store_result(conn);
    if (result ) {
    
    if((row = mysql_fetch_row(result))){
         ulong *lengths = mysql_fetch_lengths(result);
        
         pos.free();
         pos.append(row[0],lengths[0]);
       
        if (error_log)
         sql_print_information ("Http monitor *CreateServer* : processing queue position %s", pos.c_ptr());
         if( !strcmp(pos.c_ptr(), "0")){
             
             String dropisserver; 
             dropisserver.append( "DROP SERVER IF EXISTS `http_is_");
             dropisserver.append( remove_letter(ServerName,'/').c_str() );
             dropisserver.append("`"); 
             if(runQueryConn( conn ,&dropisserver)){
              finish_with_error(conn, &dropisserver);  
                  return 0;
             }
             
             String droppfserver; 
             droppfserver.append( "DROP SERVER IF EXISTS `http_ps_");
             droppfserver.append( remove_letter(ServerName,'/').c_str() );
             droppfserver.append("`"); 
             if(runQueryConn( conn ,&droppfserver)){
              finish_with_error(conn, &droppfserver);  
                  return 0;
             }
             
             
             String addisserver; 
            
             addisserver.append( "CREATE SERVER `http_is_");
             addisserver.append( remove_letter(ServerName,'/').c_str() );
             addisserver.append("` FOREIGN DATA WRAPPER mysql OPTIONS( HOST '");
             addisserver.append(url->getHost().str);
             addisserver.append("',DATABASE 'information_schema',USER '");
             addisserver.append(http_monitor::conn_user);
             addisserver.append("',PASSWORD '");
             addisserver.append(http_monitor::conn_password);
             addisserver.append("',PORT ");
             addisserver.append(url->getPort().str);
             addisserver.append(")");
             String addpfserver; 
             addpfserver.append( "CREATE SERVER `http_ps_");
             addpfserver.append( remove_letter(ServerName,'/').c_str() );
             addpfserver.append("` FOREIGN DATA WRAPPER mysql OPTIONS( HOST '");
             addpfserver.append(url->getHost().str);
             addpfserver.append("',DATABASE 'performance_schema',USER '");
             addpfserver.append(http_monitor::conn_user);
             addpfserver.append("',PASSWORD '");
             addpfserver.append(http_monitor::conn_password);
             addpfserver.append("',PORT ");
             addpfserver.append(url->getPort().str);
             addpfserver.append(")");
           
             if(runQueryConn( conn ,&addpfserver)){
              finish_with_error(conn, &addpfserver);  
                  return 0;
             }
             if(runQueryConn( conn ,&addisserver)){
              finish_with_error(conn, &addisserver);  
                  return 0;
             } 
         }
    }
    
        mysql_free_result(result); 
    }
    }   
  
    return  0;
}



void finish_with_error(MYSQL *conn, String *query)
{
  sql_print_error("Error: running %s,%s", query->c_ptr(), mysql_error(conn));
  //mysql_close(conn);
          
}




